import React from 'react';

function Home() {
  return (
    <div
      style={{
        backgroundImage: url('images.weserv.nl/?url=i.imgur.com/6QJjYMe.jpg'),
        backgroundSize: 'cover',
        margin: 0
      }}>
      <h1>Home</h1>
    </div>
  );
}

export default Home;
